(11070, '9806000900', 'Insumos,  materias  primas,  materiales  auxiliares,  envases  y  empaques  que  no  estén  sujetos  al cumplimiento  de  regulaciones  y  restricciones  no  arancelarias  en  materia  de  sanidad  animal  y vegetal,  salud  pública,  medio  ambiente  y  seguridad  nacional,  que  se  destinen  al  régimen  de recinto fiscalizado estratégico, por parte de las personas autorizadas para operar el régimen. Las mercancías  objeto  de  almacenaje,  consolidación  de  carga,  así  como  las  resultantes  de  los procesos de elaboración, transformación o reparación en el recinto fiscalizado estratégico, cuando se extraigan del recinto deberán ser clasificadas en términos de la Tarifa de esta Ley y cumplir, en su   caso,   con   las   regulaciones   y   restricciones   no   arancelarias   que   correspondan   a   esas mercancías, en los términos de las disposiciones que resulten aplicables.', 1, '2021-12-15 00:14:11', NULL, 0, NULL),
(11071, '9806001000', 'Maquinaria  y  equipo,  que  no  estén  sujetas  al  cumplimiento  de  regulaciones  y  restricciones  no arancelarias en materia de sanidad animal y vegetal, salud pública, medio ambiente y seguridad nacional,  que  se  destinen  al  régimen  de  recinto  fiscalizado  estratégico,  por  parte  de  personas autorizadas para operar el régimen. Cuando las mercancías se extraigan del recinto deberán ser clasificadas en términos de la Tarifa de esta Ley y cumplir, en su caso, con las regulaciones y restricciones  no  arancelarias  que  correspondan  a  esas  mercancías,  en  los  términos  de  las disposiciones que resulten aplicables.', 1, '2021-12-15 00:14:11', NULL, 0, NULL),
